import blackwidow from '../../../../img/blackWidow.png'
import spiderman from '../../../../img/spiderman.png'
import ironman from '../../../../img/ironman.png'
import hulk from '../../../../img/hulk.png'
import hawkeye from '../../../../img/hawkeye.png'
import captainAmerica from '../../../../img/captainAmerica.png'
import avengers from '../../../../img/avengers.png'
import thor from '../../../../img/thor.png'

export const RenderAvenger=(props) =>{
    switch(userName){
      case 'Spider Man':
        return <img src={spiderman} alt='spiderman'/>;
     case 'Black Widow':
          return <img src={blackwidow} alt='blackwidow'/>;  
          case 'Iron Man':
          return <img src={ironman} alt='ironman'/>; 
          case 'Hawk Eye':
          return <img src={hawkeye} alt='hawkeye'/>; 
          case 'Thor':
          return <img src={thor} alt='thor'/>; 
          case 'Capitán América':
          return <img src={captainAmerica} alt='captainAmerica'/>; 
          case 'Hulk':
          return <img src={hulk} alt='hulk'/>; 
          default:
            return <img src={avengers} alt='avengers'/>;
    }
    
  }
